import axios from "axios";
import { useEffect, useState } from "react"; //to use function to get information  and useState to store data
import { BrowserRouter as Router, Route, Routes, Navigate } from "react-router-dom";
import { Navigation, Home, Contact, SignUp, SignIn, DoctInfo, Logout, DoctAss, Profileusers, Profiledoctor } from "./components";
function App() {
  const [isauthenticated, setisauthenticated] = useState(false);
  const [username, setusername] = useState('');
  const [countdrassignment, setcountdrassignment] = useState(0);
  const [countalldoctor, setcountalldoctor] = useState(0);



  useEffect(() => {
    fetchMyAPI();
    console.log("");
  })

  async function fetchMyAPI() {
    await axios.get("http://localhost:4000/signin", { withCredentials: true })
      .then(res => {
        setisauthenticated(res.data.isauthenticated);
        setusername(res.data.username);
        setcountdrassignment(res.data.countdrassignment);
        setcountalldoctor(res.data.countalldoctor);
      }).catch(error => console.log(error));
  }

  //#region  Routers
  function RouterProfiledoctor() {
    if (isauthenticated) {
      return (
        <Route exact path="/doctorprofile/:doctorid" element={<Profiledoctor />} />
      )
    }
    else {
      return (
        <Route exact path="/doctorprofile/:doctorid" element={<Navigation replace to="/" />} />
      )
    }
  }
  function RouterDocAss() {
    if (isauthenticated) {
      return (
        <Route exact path="/doctorAPP" element={<DoctAss />} />
      )
    }
  }
  function RouterProfileusers() {
    if (isauthenticated) {
      return (
        <Route exact path="/userprofile" element={<Profileusers />} />
      )
    }
  }
  function RouterHome() {
    if (true) {
      return (
        <Route exact path="/" element={<Home />} />
      )
    }
  }
  function RouterLogout() {
    if (isauthenticated) {
      return (
        <Route exact path="/logout" element={<Logout />} />
      )
    }
    else {
      return (
        <Route path="/logout" element={<Navigate replace to="/" />} />
      )
    }
  }
  function RouterSignUp() {
    if (!isauthenticated) {
      return (
        <Route path="/signup" element={<SignUp />} />
      )
    }
    else {
      return (
        <Route path="/signup" element={<Navigate replace to="/doctorAPP" />} />
      )
    }
  }
  function RouterSignIn() {
    if (!isauthenticated) {
      return (
        <Route path="/signin" element={<SignIn />} />
      )
    }
    else {
      return (
        <Route path="/signin" element={<Navigate replace to="/doctorAPP" />} />
      )
    }
  }
  function RouterContact() {
    if (true) {
      return (
        <Route path="/contact" element={<Contact />} />
      )
    }
  }
  function RouterDoctInfo() {
    console.log(isauthenticated);
    switch (isauthenticated) {
      case true:
        return (
          <Route path="/doctorNotAPP" element={<DoctInfo countalldoctor={countalldoctor} countdrassignment={countdrassignment} isauthenticated={isauthenticated} />} />
        );

      case false:
        return (
          <Route path="/doctorNotAPP" element={<Navigate replace to="/" />} />
        );
    }
  }
  //#endregion

  return (
    <div className="App">
      <Router>
        <Navigation countalldoctor={countalldoctor} countdrassignment={countdrassignment} isauthenticated={isauthenticated} username={username} />
        <Routes>
          {RouterHome()}
          {RouterSignUp()}
          {RouterContact()}
          {RouterDoctInfo()}
          {RouterSignIn()}
          {RouterLogout()}
          {RouterDocAss()}
          {RouterProfileusers()}
          {RouterProfiledoctor()}
        </Routes>
      </Router>
    </div>
  );
}
export default App;
